import './reset.css'
import './App.css';
import './build/main.css'
import Main from '../src/organism/main'
import Header from './organism/Header'
import { useEffect, useState } from 'react';
function App() {
  const [data, setData] = useState(null)

    useEffect(()=>{
      fetch('./data.json').then(
        function (res) {
          return res.json()
        }).then(function (data) {
          setData(data)
        }).catch(
          function (err) {
            console.log(err, "error")
          }
        )

    },[])


  return (

    <div>
        <Header />

       {
        data?
        data.map(
          function(data) {
            return (
           <Main mobileData={data.bank} /> 
            )
          }
        ):"dataNotFound"
       }


    </div>


  );
}

export default App;
